$(function(){
  // Audio
  try {
    var testaudio = new Audio("");
    if(testaudio.canPlayType){
      var canPlayOgg = ("" != testaudio.canPlayType("audio/ogg"));
      var canPlayMp3 = ("" != testaudio.canPlayType("audio/mp3"));
      if(canPlayOgg){
        var StHe = "data:audio/ogg;base64,";
        var StWarai = "data:audio/ogg;base64,";
        var StUn = "data:audio/ogg;base64,";
        var StOh = "data:audio/ogg;base64,";
        var StIine = "data:audio/ogg;base64,";
        var StE = "data:audio/ogg;base64,";
      }else if(canPlayMp3){
        var StHe = "data:audio/mp3;base64,";
        var StWarai = "data:audio/mp3;base64,";
        var StUn = "data:audio/mp3;base64,";
        var StOh = "data:audio/mp3;base64,";
        var StIine = "data:audio/mp3;base64,";
        var StE = "data:audio/mp3;base64,";
      }else{
        window.alert('ogg,mp3');
        throw "oggmp3";
      }
    }else{
      throw "canPlayType";
    }
  } catch (e) {
    testaudio = null;
    window.alert('HTML5 Audio');
  }


  //// Handlers for UI
  // 
  $('#he-button').bind('click', function(){
    socket.emit('he');
    new Audio(StHe).play();
  });
  $('#sample-he-button').bind('click', function(){
    new Audio(StHe).play();
  });
  // 
  $('#warai-button').bind('click', function(){
    socket.emit('warai');
    new Audio(StWarai).play();
  });
  // 
  $('#un-button').bind('click', function(){
    socket.emit('un');
    new Audio(StUn).play();
  });
  // 
  $('#oh-button').bind('click', function(){
    socket.emit('oh');
    new Audio(StOh).play();
  });
  // 
  $('#iine-button').bind('click', function(){
    socket.emit('iine');
    new Audio(StIine).play();
  });
  // 
  $('#e-button').bind('click', function(){
    socket.emit('e');
    new Audio(StE).play();
  });


  //// Handlers for WebSocket
  // 
  socket.on('he-from-another', function(){
    new Audio(StHe).play();
  });
  // 
  socket.on('warai-from-another', function(){
    new Audio(StWarai).play();
  });
  // 
  socket.on('un-from-another', function(){
    new Audio(StUn).play();
  });
  // 
  socket.on('oh-from-another', function(){
    new Audio(StOh).play();
  });
  // 
  socket.on('iine-from-another', function(){
    new Audio(StIine).play();
  });
  // 
  socket.on('e-from-another', function(){
    new Audio(StE).play();
  });
  // 
  socket.on('another-connected', function(){
    console.log('Another user has been connected.');
  });

  // UI for Tablet and Phone.
  $('.sidebar-nav .channel-list').click(function(){
    $('.sidebar-nav .channel').toggleClass('visible');
  });
});
